export const SideBarContainer = styled.aside `
position: fixed;
    z-index: 999;
    width: 100%;
    height: 100%;
    background-color: #0C0920;
    display: grid;
    align-items: center;
    left: 0;
    transition: 0.3s ease-in-out;
    top: 0;
    opacity: 100%;
    /* opacity: ${({ isOpen })=> (isOpen ? '100' : '0')}; */
    /* top: ${({ isOpen }) => (isOpen ? '0' : '-100') }; */
`
